import React from "react";
import styled from "styled-components";

const StyleCulcolator = styled.div`
    background-color: #718792;
    width: 350px;
    height: 560px;
    margin: auto;
    display: flex;
    flex-direction: column;
    margin-top: 150px;
    border-radius: 10px;
`;

const Display = styled.div`
    width: 320px;
    height: 70px;
    background-color: #eceff1;
    border-radius: 10px;
    margin: auto;
    margin-top: 20px;
`;

const Keyboard = styled.div`
    width: 320px;
    height: 430px;
    /* background-color: #90a4ae; */
    margin: auto;

    border-radius: 10px;
    display: flex;
    flex-wrap: wrap;
    justify-content: space-between;
    margin-bottom: 15px;
`;

const Button = styled.div`
    width: 70px;
    height: 80px;
    background-color: #62757f;
    border-radius: 10px;
    text-align: center;
    line-height: 75px;
    font-family: "Jua", sans-serif;
    font-size: 25px;
`;

const ClearButton = styled.div`
    width: 320px;
    height: 70px;
    background-color: #62757f;
    text-align: center;
    border-radius: 10px;
    line-height: 65px;
    font-family: "Jua", sans-serif;
`;
const Culcolator = () => {
    return (
        <StyleCulcolator>
            <Display></Display>
            <Keyboard>
                <Button>7</Button>
                <Button>8</Button>
                <Button>9</Button>
                <Button>/</Button>
                <Button>4</Button>
                <Button>5</Button>
                <Button>6</Button>
                <Button>+</Button>
                <Button>1</Button>
                <Button>2</Button>
                <Button>3</Button>
                <Button>-</Button>
                <Button>.</Button>
                <Button>0</Button>
                <Button>=</Button>
                <Button>x</Button>
                <ClearButton>Clear</ClearButton>
            </Keyboard>
        </StyleCulcolator>
    );
};

export default Culcolator;
